v_msg_pb_feed_item(#pb_feed_item{action = F1, item = F2, share_stanzas = F3}, Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> 'v_enum_pb_feed_item.Action'(F1, [action | Path], TrUserData)
